import React from "react";
import Header from "../../Components/header";
import "./style.css";

export default function Checkout() {
  return (
    <div className="checkout">
      <Header />
      <div className="content_wrapper">
        <div className="cart_label">Shopping Cart</div>
      </div>
    </div>
  );
}
